import Vue from 'vue'
import Router from 'vue-router'
import Layout from '@/layout/Layout.vue'
Vue.use(Router)

export default new Router({
  routes: [
   {
      path:'/',
      name:'Layout',
      component:Layout,
      children:[
        {
          path:'home',
          name:'Home',
          component: () => import("@/views/Home")
        }
      ]
    },
    {
      path:'/login',
      component:'Login',
      component: ()=> import("@/views/Login")
    },

  ]
})
